import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Home from './Home';
import Shop from './Shop';
import Contact from './Contact';
import About from './About';

const Navbar = () => {
  const [menuVisible, setMenuVisible] = useState(false);

  const toggleMenu = () => {
    setMenuVisible(!menuVisible);
  };

  return (
    <header>
      <div className="logo"><a href="#">Maine Coon Ohio</a></div>
      <div className={`menu ${menuVisible ? 'visible' : ''}`}>
        <a href="#"><ion-icon name="close" className="close" onClick={toggleMenu} /></a>
        <ul>
          <li><Link to='/' className="under" onClick={toggleMenu}>HOME</Link></li>
          <li><Link to='/' className="under" onClick={toggleMenu}>INFORMATION</Link></li>
          <li><Link to='/about' className="under" onClick={toggleMenu}>ABOUT US</Link></li>
          <li><Link to='/contact' className="under" onClick={toggleMenu}>CONTACT INFO</Link></li>
        </ul>
      </div>
      <div className="search">
        <input type="text" placeholder="search products" id="input" />
        <ion-icon className="s" name="search" />
      </div>
      <div className="heading">
        <ul>
          <li><Link to={Home} className="under">HOME</Link></li>
          <li><Link to={Shop} className="under">INFORMATION</Link></li>
          <li><Link to={About} className="under">ABOUT US</Link></li>
          <li><Link to={Contact} className="under">CONTACT INFO</Link></li>
        </ul>
      </div>
      <div className="heading1">
        <ion-icon name="menu" className="ham" onClick={toggleMenu} />
      </div>
    </header>
  );
};

export default Navbar;
